import Intro from './pages/intro';
import News from './pages/news_article';
import Product from './pages/product';
import Routes from './controllers/route';
import { BrowserRouter } from 'react-router-dom';




function App() {
  return ( <BrowserRouter>
    <div className="App">
    <Header/>
    <main>
      <Intro/>
      <Product/>
      <News/>
      <About/>
      <Contact/>
    </main>

    <Footer/>
    </div>
    </BrowserRouter>
  );
}

export default App;
